import React from 'react'
import styled from 'styled-components'
import NavBar from '../component/NavBar'

function Home() {
    return (
        <Homecotainer>
            <NavBar />
        </Homecotainer>
    )
}

export default Home

const Homecotainer = styled.div`
min-height: 100vh;
width: 100%;

display: flex;
flex-direction: row;
`
